import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Employees from "./pages/Employees";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/employees" element={<Employees />} />
      </Routes>
    </Router>
  );
}

export default App;
